import React from 'react';
import me from './assets/me.jpeg';
import { Layout } from './layout/Layout.js';

function Book() {
  return (
    <Layout>
      <div className="text-block-left small">
        <p>
          Buy my book!
        </p>
      </div>
    </Layout>
  );
}

export default Book;
